import img from './img/lion.jpg'
// const img='https://source.unsplash.com/500x500/?lion'

const Array = [
    {
        img:<img/>,
        title:'title1'
    },
    {
        img:{img},
        title:'title2'
    },
    {
        img:{img},
        title:'title3'
    },
    {
        img:{img},
        title:'title4'
    },
    {
        img:{img},
        title:'title5'
    },
    {
        img:{img},
        title:'title6'
    },
];

export default Array;
